// getList.js
import axios from 'axios';

export const getSpreadsheetData = async () => {
    try {
        const response = await axios.get('http://localhost:5000/fetch-spreadsheet-data');
        // Assuming each row is an array, and the date is the second element (index 1)
        const sortedData = response.data.sort((a, b) => {
            // Convert to date objects to compare
            return new Date(b[1]) - new Date(a[1]);
        });
        return sortedData;
    } catch (error) {
        console.error("Error fetching spreadsheet data:", error);
        throw error; // Re-throw the error to be handled by the calling code
    }
};
